import RegistrationInfo from '../components/RegistrationInfo';

function RegistrationPage() {
    return (
        <div>
            <h2>
                Consider registering today!
            </h2>
            <p>
                Please regsiter below to get exclusive offers and coupons!
            </p>
            <RegistrationInfo/>
        </div>
    );
}

export default RegistrationPage;
